// src/pages/JobsPage.jsx
import React, { useState, useEffect } from "react";
import JobCard from "../components/JobCard";

const JobsPage = () => {
  const [recommendedJobs, setRecommendedJobs] = useState([]);
  const [allJobs, setAllJobs] = useState([]);
  const [filteredJobs, setFilteredJobs] = useState([]);
  const [filters, setFilters] = useState({ search: "", location: "", type: "" });

  useEffect(() => {
    // Fetch Recommended Jobs using ML model (mocked for now)
    const mockRecommendedJobs = [
      {
        id: 1,
        title: "AI Specialist",
        company: "DeepMind",
        location: "London, UK",
        description: "Exciting role in AI research...",
        source: "ML Recommendation",
      },
    ];
    setRecommendedJobs(mockRecommendedJobs);

    // Fetch All Jobs from the database (mocked for now)
    const mockAllJobs = [
      {
        id: 2,
        title: "Frontend Developer",
        company: "Tech Corp",
        location: "New York, USA",
        description: "We are looking for a talented frontend developer...",
        source: "Posted",
      },
      {
        id: 3,
        title: "Backend Developer",
        company: "InnovateX",
        location: "San Francisco, USA",
        description: "Join our team as a backend developer...",
        source: "Posted",
      },
      {
        id: 4,
        title: "UI/UX Designer",
        company: "Designify",
        location: "Los Angeles, USA",
        description: "Looking for a UI/UX Designer with experience in Figma...",
        source: "Posted",
      },
    ];
    setAllJobs(mockAllJobs);
    setFilteredJobs(mockAllJobs); // Initialize with all jobs
  }, []);

  // Handle Filters
  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters((prev) => ({ ...prev, [name]: value }));

    // Filter jobs
    const filtered = allJobs.filter((job) => {
      const matchesSearch = job.title.toLowerCase().includes(filters.search.toLowerCase());
      const matchesLocation = !filters.location || job.location.includes(filters.location);
      const matchesType = !filters.type || job.title.toLowerCase().includes(filters.type.toLowerCase());
      return matchesSearch && matchesLocation && matchesType;
    });
    setFilteredJobs(filtered);
  };

  return (
    <div className="p-6 space-y-6">
      <h1 className="text-3xl font-bold text-[#00ADB5]">Job Listings</h1>

      {/* Filter Section */}
      <div className="p-4 bg-gray-100 rounded-lg shadow">
        <h2 className="text-2xl font-semibold mb-4">Filters</h2>
        <div className="flex flex-wrap gap-4">
          <input
            type="text"
            name="search"
            value={filters.search}
            onChange={handleFilterChange}
            placeholder="Search by title"
            className="p-2 border rounded w-full sm:w-1/3"
          />
          <input
            type="text"
            name="location"
            value={filters.location}
            onChange={handleFilterChange}
            placeholder="Location"
            className="p-2 border rounded w-full sm:w-1/3"
          />
          <input
            type="text"
            name="type"
            value={filters.type}
            onChange={handleFilterChange}
            placeholder="Job Type (e.g., 'Full Stack')"
            className="p-2 border rounded w-full sm:w-1/3"
          />
        </div>
      </div>

      {/* Recommended Jobs Section */}
      <div>
        <h2 className="text-2xl font-semibold mb-4">Recommended Jobs</h2>
        {recommendedJobs.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {recommendedJobs.map((job) => (
              <JobCard key={job.id} job={job} />
            ))}
          </div>
        ) : (
          <p>No recommendations available at the moment.</p>
        )}
      </div>

      {/* All Jobs Section */}
      <div>
        <h2 className="text-2xl font-semibold mb-4">All Jobs</h2>
        {filteredJobs.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {filteredJobs.map((job) => (
              <JobCard key={job.id} job={job} />
            ))}
          </div>
        ) : (
          <p>No jobs found matching the filters.</p>
        )}
      </div>
    </div>
  );
};

export default JobsPage;
